    return ( 
        <div className="container">
            <div className="row">
                <div className="col">
                    <div className="row">
                        <div className="col-lg text">
                            <h5>Chatt <a href="###" alt="" className="btn btn-outline-primary">sans</a> </h5>
                            <h2>Chatting is what makes you happy</h2>
                            <p>Begin to share their favorite moments from your application with their friends on the Osans application.</p>
                            <i className="fa-weixin"></i>
                        </div>
                        <div className="col-lg imagee">
                            <img src={phonn} alt=""/>
                        </div>
                    </div>
                </div>
            </div>
        </div>
     );
}

export default TwoDesc;
